INSERT INTO `kebumian` VALUES (1,'<p>Narasi untuk nomor 1-10</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Astronomi</strong></span></span></span></p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Robot Penjelajah NASA Mengunjungi Panorama Baru nan Indah di Mars</strong></span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perseverance, robot penjelajah milik NASA di Mars, melakukan pit stop atau pemberhentian lain dalam perjalanannya untuk menyelidiki kawasan Kawah Jezero dan sekitarnya untuk mencari tanda-tanda kehidupan kuno. Robot itu berhasil mencapai daerah baru di Mars yang selama ini belum pernah dikunjungi robot penjelajah manapun.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pemandangan di Seitah bisa dibilang luar biasa indah karena bukit pasir Mars tak pernah terlihat sebagus di sini. Hal itu terlihat dalam video panorama yang menyertai twit dari akun Twitter Perseverance tersebut. Wilayah baru ini menjadi pengingat bahwa ada banyak lanskap yang tak terhitung jumlahnya yang belum kita lihat sendiri di Planet.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&quot;Memulai (penjelajahan) dengan (mengunjungi) Lantai Kawah yang Terpecah-pecah dan unit geologi Seitah memungkinkan kami untuk memulai eksplorasi Jezero sejak awal,&quot; ujar Kevin Hand, astrobiologis di Jet Propulsion Laboratory NASA.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&ldquo;Daerah ini berada setidaknya 100 meter [328 kaki] di bawah air pada 3,8 miliar tahun yang lalu,&rdquo; tambahnya. &ldquo;Kami tidak tahu cerita apa yang akan diceritakan oleh bebatuan dan singkapan berlapis itu kepada kami, tetapi kami bersemangat untuk memulai mempelajarinya.&rdquo;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Robot penjelajah beroda enam itu secara resmi memulai fase pekerjaan sainsnya pada 1 Juni 2021. Ia telah cukup jauh meninggalkan lokasi pendaratan &quot;Octavia E. Butler&quot; di mana ia mendarat awal tahun ini di Mars. Sejak saat itu Perseverance telah menempuh perjalanan sekitar 0,57 mil atau nyaris 1 kilometer, menurut data geolokasi yang dipasang di badan robot tersebut. Selama perjalanan itu, robot penjelajah tersebut telah membuat beberapa pemberhentian di sepanjang jalan untuk menjelajahi wilayah sekitarnya. Unit geologi S&eacute;&iacute;tah. yang dalam bahasa Navajo berarti &ldquo;di tengah pasir&rdquo;, berdekatan dengan lantai kawah Jezero yang dijuluki Lantai Kawah yang Terpecah-pecah (Crater Floor Fractured Rough). Daerah S&eacute;&iacute;tah dipenuhi dengan bebatuan berlapis dan bukit pasir.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Upaya penjelajahan ini bisa dilakukan berkat mode &quot;AutoNav&quot; canggih dari Perseverance, yang pada dasarnya dapat mengubah robot penjelah itu menjadi mobil yang dapat mengemudi sendiri. Jadi, robot penjelajah tersebut benar-benar bisa melaju dan berjalan di atas enam rodanya untuk menjelajahi lebih banyak wilayah di Mars.</span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sumber:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>https://nationalgeographic.grid.id/read/132768478/robot-penjelajah-nasa-mengunjungi-panorama-baru-nan-indah-di-mars?page=2</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Diketahui data planet mars sebagai berikut:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Densitas rata-rata = 3.9335 g/cm3</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jari-jari= 3.389,5 km</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setengah sumbu panjang&nbsp; = 1,52 AU</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eksentrisitas=</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">0.0935</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Astronomi</strong></span></span></span></p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Robot Penjelajah NASA Mengunjungi Panorama Baru nan Indah di Mars</strong></span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perseverance, robot penjelajah milik NASA di Mars, melakukan pit stop atau pemberhentian lain dalam perjalanannya untuk menyelidiki kawasan Kawah Jezero dan sekitarnya untuk mencari tanda-tanda kehidupan kuno. Robot itu berhasil mencapai daerah baru di Mars yang selama ini belum pernah dikunjungi robot penjelajah manapun.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pemandangan di Seitah bisa dibilang luar biasa indah karena bukit pasir Mars tak pernah terlihat sebagus di sini. Hal itu terlihat dalam video panorama yang menyertai twit dari akun Twitter Perseverance tersebut. Wilayah baru ini menjadi pengingat bahwa ada banyak lanskap yang tak terhitung jumlahnya yang belum kita lihat sendiri di Planet.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&quot;Memulai (penjelajahan) dengan (mengunjungi) Lantai Kawah yang Terpecah-pecah dan unit geologi Seitah memungkinkan kami untuk memulai eksplorasi Jezero sejak awal,&quot; ujar Kevin Hand, astrobiologis di Jet Propulsion Laboratory NASA.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&ldquo;Daerah ini berada setidaknya 100 meter [328 kaki] di bawah air pada 3,8 miliar tahun yang lalu,&rdquo; tambahnya. &ldquo;Kami tidak tahu cerita apa yang akan diceritakan oleh bebatuan dan singkapan berlapis itu kepada kami, tetapi kami bersemangat untuk memulai mempelajarinya.&rdquo;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Robot penjelajah beroda enam itu secara resmi memulai fase pekerjaan sainsnya pada 1 Juni 2021. Ia telah cukup jauh meninggalkan lokasi pendaratan &quot;Octavia E. Butler&quot; di mana ia mendarat awal tahun ini di Mars. Sejak saat itu Perseverance telah menempuh perjalanan sekitar 0,57 mil atau nyaris 1 kilometer, menurut data geolokasi yang dipasang di badan robot tersebut. Selama perjalanan itu, robot penjelajah tersebut telah membuat beberapa pemberhentian di sepanjang jalan untuk menjelajahi wilayah sekitarnya. Unit geologi S&eacute;&iacute;tah. yang dalam bahasa Navajo berarti &ldquo;di tengah pasir&rdquo;, berdekatan dengan lantai kawah Jezero yang dijuluki Lantai Kawah yang Terpecah-pecah (Crater Floor Fractured Rough). Daerah S&eacute;&iacute;tah dipenuhi dengan bebatuan berlapis dan bukit pasir.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Upaya penjelajahan ini bisa dilakukan berkat mode &quot;AutoNav&quot; canggih dari Perseverance, yang pada dasarnya dapat mengubah robot penjelah itu menjadi mobil yang dapat mengemudi sendiri. Jadi, robot penjelajah tersebut benar-benar bisa melaju dan berjalan di atas enam rodanya untuk menjelajahi lebih banyak wilayah di Mars.</span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sumber:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>https://nationalgeographic.grid.id/read/132768478/robot-penjelajah-nasa-mengunjungi-panorama-baru-nan-indah-di-mars?page=2</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Diketahui data planet mars sebagai berikut:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Densitas rata-rata = 3.9335 g/cm3</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jari-jari= 3.389,5 km</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setengah sumbu panjang&nbsp; = 1,52 AU</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eksentrisitas=</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">0.0935</span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pernyataan mengenai planet mars yang benar berikut ini adalah&hellip;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pembentukan satelit alami planet mars berhubungan dengan asteroid pada sabuk kuiper</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Air pada permukaan planet mars dapat ditemukan dalam bentuk cair pada kedua kutubnya</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berbeda dari Bumi, Planet mars tidak mengalami aktivitas geologis akibat banyaknya aktivitas astronomis seperti badai matahari</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Planet mars adalah gambaran bumi pada masa depan</span></span></span></span></p>','<p>Semua Jawaban Benar</p>',2,'d'),(2,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika robot penjelajah mars mengambil gambar dari ketinggian 120 km dengan resolusi sudut pisah 0,6&rdquo; , berapakah diameter benda terkecil yang dapat diamati robot tersebut?</span></span></span></p>','<p>0,35 m</p>','<p>72 m</p>','<p>35 m</p>','<p>0,072 m</p>','<p>0,57 m</p>',2,'a'),(3,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sebuah batu dilempar lurus dari tebing setinggi 15 m. Berapakah perbandingan kecepatan batu tersebut di dasar planet mars dibandingkan dengan planet berjari-jari 4 kali dan massa jenis sama dengan mars?</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 1:2</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 2:1</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 4:3</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 1:4</span></span></