000000; vertical-align:middle; width:38px\">			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">9</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:middle; width:38px\">			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">2</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:middle; width:38px\">			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">6</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:middle; width:38px\">			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">8</span></span></span></p>			</td>		</tr>	</tbody></table></div><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Contoh F(&quot;0123&quot;) = &quot;3715&quot; dan F(F(&quot;0123&quot;)) = F(&quot;3715&quot;) = &quot;5274&quot;.</span></span></span></p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek akan mengirim kode &quot;0123456789&quot;. Sebelum mengirimkan kodenya, ia akan mengubahnya menggunakan fungsi F sebanyak 2021 kali. Kode yang akan dikirim Pak Dengklek adalah .... </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'3715049268'),(19,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek mempunyai himpunan bilangan {12, 10, 4, 42, 7, 31, 5, 9, 15, 20}. Ia ingin membuat semua bilangan dalam himpunan tersebut bernilai sama. Dalam satu langkah, Pak Dengklek dapat menambahkan 1 kepada tepat 9 bilangan dalam himpunan tersebut. Contohnya, Pak Dengklek dapat menambahkan 1 kepada bilangan pertama sampai kesembilan, sehingga himpunan menjadi {13, 11, 5, 43, 8, 32, 6, 10, 16, 20}. Berapa banyak langkah minimum yang dibuhtuhkan Pak Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'115'),(20,'<p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em><u>Berikut merupakan deskripsi untuk soal nomor 20 dan 21.</u></em></strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek dan Pak Ganesh sedang bermain tebak angka. Pak Dengklek mempunyai sebuah bilangan bulat positif rahasia N yang akan ditebak oleh Pak Ganesh. Sebelum permainan dimulai, Pak Dengklek akan memberikan sebuah bilangan bulat positif M di mana N &lt; M kepada Pak Ganesh.&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Untuk mengetahui nilai dari bilangan rahasia N, Pak Ganesh dapat bertanya kepada Pak Dengklek. Pak Ganesh dapat memberikan suatu bilangan bulat positif X (lebih dari 1), dan Pak Dengklek akan menjawab suatu bilangan bulat Y maksimum sehingga X^Y habis membagi N.</span></span></span></p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Contoh apabila M = 10, permainan bisa berjalan sebagai berikut:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 2, maka Pak Dengklek menjawab Y = 1.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 3, maka Pak Dengklek menjawab Y = 1.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 4, maka Pak Dengklek menjawab Y = 0.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 5, maka Pak Dengklek menjawab Y = 0.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 6, maka Pak Dengklek menjawab Y = 1.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh memberikan X = 9, maka Pak Dengklek menjawab Y = 0.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Dengan bertanya sebanyak 6 kali, Pak Ganesh sudah yakin nilai dari N, yaitu 6 (tidak ada bilangan positif N selain 6 yang memenuhi informasi di atas).</span></span></span></li></ol><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sayangnya, Pak Ganesh tidak punya banyak waktu untuk bermain bersama Pak Dengklek. Pak Ganesh ingin mengetahui nilai bilangan N dengan bertanya seminimum mungkin.</span></span></span></p><p>&nbsp;</p><p style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila Pak Dengklek memberikan M = 10, maka banyak pertanyaan minimum yang diberikan oleh Pak Ganesh supaya ia mengetahui dengan pasti nilai dari N adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'4'),(21,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila Pak Dengklek memberikan M = 100, maka banyak pertanyaan minimum yang diberikan oleh Pak Ganesh supaya ia mengetahui dengan pasti nilai dari N adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'25'),(22,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek ingin memberi makan kelima bebeknya, yaitu Kwak, Kwek, Kwik, Kwok, dan Kwuk. Dalam memberi makan bebeknya, Pak Dengklek harus memenuhi syarat-syarat berikut:</span></span></span>	<ol>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Kwak atau Kwik harus makan.</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jika Kwak makan, maka Kwok tidak makan.</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jika Kwuk makan, maka Kwik tidak makan.</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Kwek makan jika dan hanya jika Kwok makan.</span></span></span></li>	</ol>	</li></ol><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berapa banyak maksimum bebek yang dapat diberi makan oleh Pak Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'3'),(23,'<p style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Karena hari ulang tahun Kwok semakin dekat, Kwek ingin membelikan hadiah kepada Kwok. Kwek yang tinggal di peternakan desa ingin pergi ke sebuah toko hadiah di perkotaan untuk membeli hadiah. Toko ini setiap harinya menjual hadiah dengan keindahan yang berbeda. Keindahan hadiah yang dijual toko tersebut dari hari ke-1 sampai hari ke-15 berturut-turut adalah 26, 10, -3, 24, -71, 33, -11, -15, 54, -20, 5, 13, -33, 20, dan 14.</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Karena pandemi, maka Kwek hanya bisa di kota pada hari yang berurutan. Kwek akan selalu membeli hadiah apabila ia berada di kota, tidak peduli dengan keindahan hadiah tersebut. Contohnya, apabila Kwek berada di kota pada hari ke-2 hingga hari ke-4, maka total keindahan hadiah yang dibeli adalah 10 + (-3) + 24 = 31.&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Anda sebagai teman baik Kwek ingin membantunya untuk menentukan jadwal agar bisa membeli hadiah dengan total keindahan sebanyak mungkin. Tentukan hari Kwek harus tinggal di kota! Tuliskan jawaban berupa dua bilangan dipisahkan spasi, menandakan hari awal dan hari akhir Kwek berada di kota. Misalnya Kwek harus berada di kota dari hari ke-2 hingga hari ke-7, maka tulis &ldquo;2 7&rdquo; tanpa tanda petik.</span></span></span></p><p>&nbsp;</p>','','','','','',1,'6 9'),(24,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em><u>Berikut merupakan deskripsi untuk soal nomor 24, 25, dan 26.</u></em></strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sebuah robot berada di titik (0, 0) pada bidang kartesius. Robot ini ingin mengunjungi titik (A, B) dan kembali ke titik (0, 0) dalam tepat C langkah (boleh mengunjungi suatu titik lebih dari 1 kali). Dalam satu langkah, apabila robot berada pada titik (X, Y), maka ia dapat pergi ke titik (X+1, Y), (X-1, Y), (X, Y+1), atau (X, Y-1).</span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila A = -2, B = 5, dan C = 16, apakah terdapat rute yang valid? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk &ldquo;YA&rdquo; atau &ldquo;TIDAK&rdquo; tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'ya'),(25,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila A = 20, B = -21, dan C = 85, apakah terdapat rute yang valid? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk &ldquo;YA&rdquo; atau &ldquo;TIDAK&rdquo; tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'tidak'),(26,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila A = 231, B = 83, dan C = 704, apakah terdapat rute yang valid? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk &ldquo;YA&rdquo; atau &ldquo;TIDAK&rdquo; tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'ya'),(27,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek ingin membentuk kata &ldquo;INFORMATIKA&rdquo; dari kata &ldquo;FAMNIOKRAIT&rdquo;. Ia dapat mengambil salah satu huruf, dan meletakkannya di awal atau akhir kata. Misal, Pak Dengklek mengambil huruf kedua yaitu huruf A, dan meletakkannya di akhir kata sehingga menjadi &ldquo;FMNIOKRAITA&rdquo;. Banyak operasi minimum yang dibutuhkan Pak Dengklek agar kata tersebut menjadi &ldquo;INFORMATIKA&rdquo; adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'8'),(28,'<p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em><u>Berikut merupakan deskripsi untuk soal nomor 28 dan 29.</u></em></strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Seorang polisi sedang mengejar seorang pencuri yang ingin melarikan diri. Si pencuri ingin segera menuju ke mobilnya agar bisa lolos dari polisi. Posisi mobil berada di titik (0, 0).</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Polisi dan pencuri bergerak secara bergantian, dimulai dari pencuri terlebih dahulu. Polisi mengetahui posisi dari pencuri dan pencuri juga mengetahui posisi dari polisi.</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Dalam satu gerakan, mereka dapat bergerak paling banyak sejauh 1 satuan. Dengan kata lain, apabila seseorang berada di posisi (x, y), maka ia dapat bergerak ke posisi (x, y), (x+1, y), (x-1, y), (x, y+1), atau (x, y-1).&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Polisi dikatakan menangkap pencuri apabila mereka berdua berada di titik yang sama. Si pencuri dikatakan berhasil lolos apabila berada di titik (0, 0) dan polisi berada di titik selain (0, 0). Polisi dan pencuri bergerak secara optimal.</span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila polisi berada di titik (1, 4) dan pencuri berada di titik (3, 3), apakah pencuri bisa lolos? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk &ldquo;YA&rdquo; atau &ldquo;TIDAK&rdquo; tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'tidak'),(29,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila polisi berada di titik (-1823, 544) dan pencuri berada di titik (-938, 1319), apakah pencuri bisa lolos? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk &ldquo;YA&rdquo; atau &ldquo;TIDAK&rdquo; tanpa tanda petik}</em></strong></span></span></span></p>','','','','','',1,'ya');
