INSERT INTO `matematika` VALUES (1,'<p>Diberikan ABCD segiempat konveks dengan AB = BC dan &ang;ADC = &ang;BAD + &ang;BCD. Nilai dari <sup>BD</sup>/<sub>DC</sub> adalah...</p>','','','','','',1,''),(2,'<p>Lingkaran&nbsp;dalam&nbsp;segitiga&nbsp;ABC&nbsp;dengan&nbsp;pusat&nbsp;I&nbsp;menyinggung&nbsp;sisi&nbsp;AB&nbsp;di&nbsp;C&lt;sub&gt;1&lt;/sub&gt;&nbsp;dan&nbsp;menyinggung sisi&nbsp;BC&nbsp;di&nbsp;A&lt;sub&gt;1&lt;/sub&gt;.&nbsp;Garis&nbsp;AI&nbsp;dan&nbsp;C&lt;sub&gt;1&lt;/sub&gt; A&lt;sub&gt;1&lt;/sub&gt;&nbsp;berpotongan&nbsp;di&nbsp;titik&nbsp;M.&nbsp;Jika diketahui&nbsp;bahwa&nbsp;AC&nbsp;=&nbsp;68,&nbsp;&ang;A&nbsp;=&nbsp;30&deg;,&nbsp;maka&nbsp;luas&nbsp;segitiga&nbsp;AMC adalah...</p>','','','','','',1,''),(3,'<p>Jika&nbsp;untuk&nbsp;bilangan&nbsp;real&nbsp;x {x}&nbsp;menyatakan&nbsp;bagian&nbsp;pecahan&nbsp;dari&nbsp;x,&nbsp;maka&nbsp;jumlahan&nbsp;semua solusi&nbsp;dari&nbsp;persamaan</p><p>{2{3{4x}}}&nbsp;=&nbsp;x</p><p>adalah...</p>','','','','','',1,''),(4,'<p>Banyaknya solusi bulat dari persamaan</p><p>x<sup>3</sup> (y &minus; z)<sup>3</sup> + y<sup>3</sup>(z &minus; x)<sup>3</sup> + z<sup>3</sup>(x &minus; y)<sup>3</sup> = 36</p><p>adalah...</p>','','','','','',1,''),(18,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek mempunyai himpunan bilangan {1, 4, 10}. Ia ingin membuat semua bilangan di dalam himpunan tersebut bernilai sama. Dalam satu langkah, Pak Dengklek dapat menambahkan 1 kepada tepat 2 bilangan dalam himpunan tersebut. Contohnya, Pak Dengklek dapat menambahkan 1 kepada bilangan pertama dan ketiga, sehingga himpunan menjadi {2, 4, 11}. Berapa banyak langkah minimum yang dibutuhkan Pak Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'13');
